import React from 'react';
import './App.css';

import { Button, Form, FormGroup, Label, Input }
  from 'reactstrap';

import { FacebookSignupButton } from 'react-social-login-buttons';

function App() {
  return (
    <Form className="sign-up-form">
      <h1>
        <span className="font-weight-bold">Signup : User</span> 
      </h1>
      <h2>Authentic Chef </h2>
      <FormGroup>
        <Label>Name </Label>
        <Input type = "name" placeholder = "Your Full Name" />
      </FormGroup>
      <FormGroup>
        <Label>Username </Label>
        <Input type = "username" placeholder = "Choose a username" />
      </FormGroup>
      <FormGroup>
        <Label>Password </Label>
        <Input type = "password" placeholder = "Choose a password" />
      </FormGroup>

    </Form>
  );
}

export default App;
